import * as React from "react";
import { Grid, Typography } from "@mui/material";

export default function FrontPage() {
  return (
    <Grid
      item
      xs={12}
      sx={{
        height: "100vh",
        display: "flex",
        alignItems: "center",
        padding: "50px",
      }}
    >
      <Grid item xs={12} sx={{ border: "2px solid #fff" }}>
        <Typography variant="h1">
          Hello!
          <br /> I'm Marie Thoresen
        </Typography>
      </Grid>
    </Grid>
  );
}
